    return (
        <div>
        <ProfileInfo />
        <MyPosts 
        posts={props.profilePage.posts} 
        newPostText={props.profilePage.newPostText}
        addPost={props.addPost}
        updateNewPostText={props.updateNewPostText}/>
      </div>
    )  
};

